import React, { Component } from 'react';

export default class ExerciseTrack extends Component {


  constructor(props) {
    super(props);
    this.state = {
      hours: 0,
      date: new Date()
    }
  }

  render() {
    return (
      <div>
        <p>You are on the Exercises Track component!</p>
      </div>
    )
  }
}
